import React from 'react';
import './style.scss';
import NavBar from "../../nav-bar";

const Icons = () => {
    return (
        <div>
            <NavBar name='Icons'/>
            <div className='P-icon'>
<div className='G-flex-column'>
    <p>100 Awesome Nucleo Icons</p>
    <p>Handcrafted by our friends from NucleoApp</p>
</div>

            </div>
        </div>
    );
};

export default Icons;
